import React from 'react';



const NavBar = () => {

    return (
        <div>

            <nav class="bg-moon-gray db dt-m w-100 border-box pa3 ">  <a class="db dtc-l v-mid mid-gray link dim w-100 w-25-l tc tl-l mb2 mb0-l" href="#" title="Home">
                 <img src="http://tachyons.io/img/logo.jpg" class="dib w2 h2 br-100" alt="Site Name"/>
  </a>
                <div class="db dtc-m v-mid w-100  tc ">
                    <p class="link dim grow dark-gray f6 f4-l dib mr3 mr4-l pointer"  title="Home">About Me</p>
                    <p class="link dim grow dark-gray f6 f4-l dib mr3 mr4-l pointer" title="How it Works">Skills</p>
                    <p class="link dim grow dark-gray f6 f4-l dib mr3 mr4-l pointer" title="Blog">Education</p>
                    <p class="link dim grow dark-gray f6 f4-l dib mr3 mr4-l pointer"  title="Press">Projects</p>
                    <p class="link dim grow dark-gray f6 f4-l dib pointer"  title="Contact">Contact Information</p>
                </div>
            </nav>
        </div>
    )
}

export default NavBar;
